import { combineReducers } from 'redux';
import dataReducer from './default-reducer';
import Login from './../pages/login/Reducer';
import Flight from '../pages/flight/Reducer';
import User from './../pages/user/Reducer'
import Register from '../pages/register/Reducer'
import ChangePassword from '../pages/change-password/Reducer'
import Report from '../pages/report/Reducer'
import Dashboard from '../pages/dashboard/Reducer';
import Setting from '../pages/setting/Reducer';
import DataCustomers from '../pages/user/traveler/Reducer'


const rootReducers = combineReducers({
  global: dataReducer,
  login: Login,
  flight: Flight,
  user:  User,
  register: Register,
  changePassword: ChangePassword,
  report: Report,
  dashboard:Dashboard,
  setting:Setting,
  customers: DataCustomers
});

export default rootReducers;
